The license configuration generally applies to the entire crate graph, but this means that allowing any one license applies to all possible crates, even if only 1 crate actually uses that license. The exceptions field is meant to allow licenses only for particular crates, to make a clear distinction between licenses which you are fine with everywhere, versus ones which you want to be more selective about, and not have implicitly allowed in the future. The name field The name of the crate that you are adding an exception for The version field (optional) An optional version constraint specifying the range of crate versions you are excepting. Defaults to all versions (*). The allow field This is the exact same as the general allow field. [licenses]
allow = [ "Apache-2.0", "MIT",
]
exceptions = [ # This is the only crate that cannot be licensed with either Apache-2.0 # or MIT, so we just add an exception for it, meaning we'll get a warning # if we add another crate that also requires this license { name = "cloudabi", allow = ["BSD-2-Clause"] },
]

